  return isLoggedIn ? (
    <Row>
      <>
        <Col span={4}> ICON </Col>
        <Col span={20}> CONTENT </Col>
      </>
    </Row>
  ) : (
    <div>login 필요</div>
  );
};

export default MyMenu;
